import { Button } from '@material-ui/core';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Welcome to Liv Score  </h1>
      <Button variant="outlined" color="primary">
        Show Detail
      </Button>
    </div>
  );
}

export default App;
